window.bookSummaryJSON = "<p><b>Number-one <i>New York Times</i> best-selling author Kelley Armstrong begins her new series with Omens, featuring a compelling new heroine thrust into a decades-old murder case and the dark mysteries surrounding her strange new home.</b> </p> <p>Twenty-four-year-old Olivia Taylor Jones has the perfect life. The only daughter of a wealthy, prominent Chicago family, she has an Ivy League education, pursues volunteerism and philanthropy, and is engaged to a handsome young tech firm CEO with political ambitions. </p> <p>But Olivia’s world is shattered when she learns that she’s adopted. Her real parents? Todd and Pamela Larsen, notorious serial killers serving a life sentence. When the news brings a maelstrom of unwanted publicity to her adopted family and fiancé, Olivia decides to find out the truth about the Larsens. </p> <p>Olivia ends up in the small town of Cainsville, Illinois, an old and cloistered community that takes a particular interest in both Olivia and her efforts to uncover her birth parents’ past. </p> <p>Aided by her mother’s former lawyer, Gabriel Walsh, Olivia focuses on the Larsens’ last crime, the one her birth mother swears will prove their innocence. But as she and Gabriel start investigating the case, Olivia finds herself drawing on abilities that have remained hidden since her childhood, gifts that make her both a valuable addition to Cainsville and deeply vulnerable to unknown enemies. Because there are darker secrets behind her new home and powers lurking in the shadows that have their own plans for her.</p>"; 
